import React from 'react';
import { View, Text } from "react-native";

function CameraScreen() {
    return (
      <View style={{ flex: 1, justifyContent: 'center', alignItems: 'center' }}>
        <Text>Camera</Text>
      </View>
    );
  }

  export default CameraScreen
